  import React,{useState} from 'react'
  // import db from './db';
  import { Link, useNavigate } from 'react-router-dom'

  export default function Concert() {
    //const [RegisterStatus, setRegisterStatus] = useState("");
    const navigate = useNavigate();
    const [values, setValues] = useState({
      name: '',
      email: '',
      tname: '',
      timage: '',
      date: '',
      time: '',
      ticket: '',
    });
    //const [errors, setErrors] = useState({});
    // const [concertData, setConcertData] = useState([]); // New state to store the retrieved data
  
    const handleSubmit = (e) => {
      e.preventDefault();
  
      fetch("http://localhost:8081/Create", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          name: values.name,
          email: values.email,
          username: values.username,
          password: values.password,
     
        }),
      })
        .then((res) => res.json())
        .then((data) => {
          if (data.message) {
            //setRegisterStatus(data.message);
            navigate('/Created');
          } else {
           // setRegisterStatus("Concert created");
            console.log(data);
            navigate('/Created');
          }
        })
        .catch((error) => {
          console.error("Error:", error);
        });
    };
  
    const handleInput = (event) => {
      setValues((prev) => ({ ...prev, [event.target.name]: event.target.value }));
    };
  
    // useEffect(() => {
    //   // Fetch data when the component mounts
    //   fetch('http://localhost:8081/Created')
    //     .then((res) => res.json())
    //     .then((data) => {
    //       // Update the state with the retrieved data
    //       setConcertData(data);
    //     })
    //     .catch((error) => {
    //       console.error('Error:', error);
    //     });
    // }, []); // Empty dependency array to fetch data only once when the component mounts
  
    return (
      <>
<div className='flex'>
      {/* <div className=' text-center'>
          <div className="btn-group" role="group" aria-label="Basic example">
    <button type="button" className="btn btn-success" > <Link className="nav-link " aria-current="page" to="/Create">Create New Student Registration</Link></button>
    <button type="button" className="btn btn-warning"><Link className="nav-link " aria-current="page" to="/Edit">Edit Student Registration</Link></button>
    <button type="button" className="btn btn-danger"><Link className="nav-link " aria-current="page" to="/Delete">Delete Student Registration</Link></button>
  </div>
  </div> */}

  <h1>Create New Student Registration</h1>
  <form className='mb-3'>
  <div className="mb-3 container">

    <label htmlFor="exampleFormControlInput1" className="form-label mb-3 my-3 mx-3 ">Student Name</label>
    <input type="text" onChange={handleInput} name='name' className=" my-2  " id="Concert_Name" placeholder="Enter Students Name"/>
    <label htmlFor="formFile" className="form-label col-5 "></label>
  
  </div>
  <div className="mb-3 container">
  <label htmlFor="exampleFormControlInput1" className="form-label mb-3 my-3 mx-3">PRN No.</label>
    <input type="email" onChange={handleInput} name='tname' className="my-2 mx-3 " id="Team_Name" placeholder="Enter PRN No."/>
    <label htmlFor="formFile" className="form-label col-5 "></label>
   
  </div>
  <div className="mb-3 container">
    <label htmlFor="exampleFormControlInput1" className="form-label mb-3 my-3 mx-5" type="date">Registration Date</label>
    <input type="text" onChange={handleInput} name='date' className="my-2 mx-1" id="date" placeholder="Set Date"/>
    <label htmlFor="formFile" className="form-label col-6 "></label>
    
  </div>
  <div className='text-center'>
  <div className="mb-3">

    <label htmlFor="exampleFormControlInput1" className="form-label mb-3 my-3 mx-3 col-1">Ticket Charges</label>
    <input type="number" onChange={handleInput} name='ticket' className="" id="Ticket_Fee" placeholder="Ticket Fee"/>
  </div>

  <div><button type="submit" onClick={handleSubmit} className="btn btn-success" >Submit</button>
  </div>

  </div>
  </form>
  </div>
      
      </> 
    )
};
